import logo from './logo.svg';
import React, { Component } from 'react';
import './App.css';

class App extends React.Component {

  componentDidMount() {
    navigator.geolocation.getCurrentPosition(function (positions) {
      console.log(positions);
    })
  }
  render() {
    return 1;
  }
}

export default App;
